        "title": "Quanten beim Physik-Nobelpreis 2022? Harald Lesch reagiert! | Harald Lesch | Terra X Lesch & Co",
        "description": "Wer bekommt den #Nobelpreis für #Physik 2022? Harald Lesch musste seine Dreharbeiten für Leschs Kosmos heute kurz unterbrechen, um die Nobelpreis-Bekanntgabe per Livestream miterleben zu können. Der Preis geht in drei gleichen Teilen an Quantenphysiker, welche sich mit ihrer Arbeit einem besonders irren Phänomen verschrieben haben: der Verschränkung. Quantenteilchen z.B. Photonen oder Elektronen bleiben untrennbar miteinander verbunden, selbst wenn man sie räumlich voneinander entfernt. Wenn sich das eine Teilchen verändert hat das Auswirkungen auf das andere. Alain Aspect, John Clauser und Anton Zeilinger haben mit ihrer Arbeit gezeigt, dass Einsteins verhasste „spukhafte Fernwirkung“ Teil unserer Wirklichkeit ist und kein Ausdruck der Unvollständigkeit der Quantenmechanik. Darüber hinaus liefert ihre Arbeit wichtige Beiträge, um Technologien wie Quantenkryptografie und Quantencomputer zu entwickeln! Harald Lesch kommentiert gemeinsam mit Astrophysiker Marco Smolla. \n\nZum Nobelpreis 2016: https://www.nobelprize.org/prizes/physics/2016/press-release/\nDie Verleihung in ganzer Länge: https://www.youtube.com/watch?v=O0sLYBeaaAM \n\nDieses Video ist eine Produktion des ZDF, in Zusammenarbeit mit objektiv media. \n\nAbonnieren? Einfach hier klicken - http://www.youtube.com/terrax_leschundco/?sub_confirmation=1\n\nMehr Informationen zu Terra X findet ihr hier -  https://www.zdf.de/dokumentation/terra-x?at_medium=custom3&at_campaign=314&at_custom1=youtube \n\n\"Leschs Kosmos\" gibt es auf dieser Seite - https://www.zdf.de/wissen/leschs-kosmos?at_medium=custom3&at_campaign=314&at_custom1=youtube \n\nTerra X bei Facebook - https://www.facebook.com/ZDFterraX\n\nGrafiken: Kurzgesagt - In a Nutshell",
