          "title": "[Eng Sub] Vice Versa รักสลับโลก | EP.12 [4/4] | ตอนจบ | Uncut Version",
          "description": "“ทะเล” (ซี ทวินันท์) ตื่นขึ้นมาในร่างของ “เทสส์” (โอม ภวัต) มาเจอกับ “ปืน” (จิมมี่ จิตรพล) ดาราหนุ่มชื่อดังที่เกิดอุบัติเหตุทำให้ต้องมาอยู่ในร่างของ “ทัน” (นนน กรภัทร์) ทั้งสองต้องใช้ชีวิตบนโลกใหม่ที่ไม่คุ้นเคย และอาจเป็น “กุญแจนำทาง\" ของกันและกัน ที่สามารถช่วยให้กลับโลกเดิมได้ เมื่อร่วมกันสานฝันบางอย่างของร่างเดิมสำเร็จ โดยมี “ภูวดล” (หมอเจี๊ยบ ลลนา) บุรุษพยาบาลที่คอยแนะนำเกี่ยวกับโลกใหม่นี้ และให้ความช่วยเหลือคนที่มาจากโลกใบเดิมเช่นเดียวกับทั้งสอง\nภารกิจพิชิตฝันของทัน ทะเล และแก๊งเพื่อนที่คอยช่วยเหลืออย่าง “คีตะ” (เปปเปอร์ ภานุโรจน์) “ฟิวส์” (บูม ธราธร) รวมถึงสมาชิก Friend Credits อย่าง “อัพ” (นีโอ ตรัย) และ “อู๋” (อู๋ ธนบูรณ์) กับเรื่องราวความรัก และมิตรภาพที่เกิดขึ้นในโลกใบใหม่ ภารกิจพิชิตฝันจะเป็นอย่างไร พวกเขาจะได้กลับโลกใบเดิมหรือไม่\n\nนำแสดงโดย\nจิตรพล โพธิวิหค  รับบท ปืน\nทวินันท์ อนุกูลประเสริฐ รับบท ทะเล\nภานุโรจน์ เฉลิมกิจพรทวี รับบท คีตะ\nธราธร จันทรวรกาญจน์ รับบท ฟิวส์\nธนบูรณ์ เกียรตินิรันดร์ รับบท อู๋\nตรัย นิ่มทวัฒน์  รับบท อัพ\nลลนา ก้องธรนินทร์  รับบท ภูวดล\nมณีรัตน์ คำอ้วน  รับบท จุ๊บแจง\nภวัต จิตต์สว่างดี  รับบท เทสส์ \nกรภัทร์ เกิดพันธุ์   รับบท ทัน\n\nกำกับซีรีส์ : เอ็กซ์ ณัฐพงษ์ มงคลสวัสดิ์\n\nติดตาม Vice Versa รักสลับโลก \nทุกวันเสาร์ เวลา 20:30 น. ทางช่อง GMM25 \nและทาง Youtube: GMMTV พร้อมกันทั่วโลก\n\nเพลงประกอบซีรีส์\nเป็นเธอใช่ไหม (Have I Found) Ost.Vice Versa รักสลับโลก - Sea Tawinan\nhttps://www.youtube.com/watch?v=5YNIfcu8-ZU\nThe Key Ost.Vice Versa รักสลับโลก - Jimmy Jitaraphol, Sea Tawinan\nhttps://www.youtube.com/watch?v=N24CTfhYuaU\nไม่ชัดเจน (Complicated) Ost.Vice Versa รักสลับโลก - Indy Thanathat\nhttps://www.youtube.com/watch?v=-XFIhaghT1A\nมีเพียงเธอ (By My Side) Ost.Vice Versa รักสลับโลก - Jimmy Jitaraphol\nhttps://www.youtube.com/watch?v=KXqxbNezT44\n\nติดตามทุกความเคลื่อนไหวของ GMMTV ได้ที่\nFacebook | https://www.facebook.com/GMMTVOFFICIAL\u200b\u200b\nYouTube | https://www.youtube.com/GMMTV\u200b\u200b\nYouTube | https://www.youtube.com/GMMTVRECORDS\nInstagram | https://www.instagram.com/GMMTV\u200b\u200b\nTwitter | https://www.twitter.com/GMMTV\u200b\u200b\nTikTok | http://vm.tiktok.com/RLrVAC\u200b\u200b\nWeibo | http://www.weibo.com/u/6146914790\u200b\u200b\nWebsite | http://www.gmm-tv.com\u200b\u200b\n\nติดต่อโฆษณา \nคุณชนิดา วงศ์ธนาภักดี โทร 02-669-8330 \nchanida.won@gmm-tv.com\n\n#ViceVersa #GMMTV \n\nSubtitles\nPortuguese (Brazil) : @JimmySeaBr (Twitter and Instagram)\nTurkish : MyFriendSub-OkRu\nBurmese : @JimmySeaMyanmar (Twitter) , Grow Up With JimmySea from Myanmar (Facebook)\nFrench : SeoRin x Elea Kayne (CHOPTONBL)"
